package Practice;

public class If_block {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=100;
		int b=10;
		
		if (b>a)
		{
			System.out.println("b>a");
		}

		if (b<a)
		{
			System.out.println("b<a");
		}

		if (b==a)
		{
			System.out.println("b==a");
		}
		if (b<=a)
		{
			System.out.println("b<=a");
		}

		
	}

}
